import React, { useEffect, useState } from "react";

function Cards() {
  const [loading, setLoading] = useState(true);
  const [picsArrived, setPicsArrived] = useState(false);
  let ExampleArr = ["heloo", "meh", "lame", "brother", "layman"];

  useEffect(() => {
    setTimeout(() => {
      setPicsArrived(true);
      setLoading(false);
      console.log("use effect used");
    }, 2000);
  }, []);
  let checkArr = [];
  function changeOrder() {
    for (let i = 0; i < ExampleArr.length; i++) {
      var index = Math.floor(ExampleArr.length * Math.random());
      console.log(index);
    }
  }
  return (
    <div className="container">
      {loading && <h1 className="loadingHead">Loading...</h1>}
      {picsArrived && (
        <div className="CardsRendered">
          {ExampleArr.map((e) => {
            return <h1 onClick={changeOrder}>{e}</h1>;
          })}
        </div>
      )}
    </div>
  );
}

export default Cards;
